-- Name: FUNCTION accept_agent_invitation(invitation_token text, user_uuid uuid); Type: COMMENT; Schema: public; Owner: postgres
--

COMMENT ON FUNCTION public.accept_agent_invitation(invitation_token text, user_uuid uuid) IS 'Accept an agent invitation, create agent profile, and associate with workspace';


--
-- Name: add_creator_as_admin(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.add_creator_as_admin() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
BEGIN
    -- Add creator as admin member
    INSERT INTO public.workspace_members (workspace_id, user_id, role)
    VALUES (NEW.id, NEW.owner_id, 'admin');
    
    -- Create default Admin role for the workspace
    -- This calls the function defined in roles_workspace_scope.sql
    PERFORM public.create_default_workspace_roles(NEW.id);
    
    RETURN NEW;
END;
$$;


