--
-- Name: assign_agent_to_chat(integer, uuid, uuid, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.assign_agent_to_chat(p_conversation_id integer, p_agent_id uuid, p_team_id uuid DEFAULT NULL::uuid, p_assigned_by uuid DEFAULT NULL::uuid) RETURNS uuid
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    assignment_id UUID;
BEGIN
    -- Unassign any existing active assignments for this conversation
    UPDATE public.chat_assignments
    SET status = 'transferred',
        unassigned_at = timezone('utc'::text, now())
    WHERE conversation_id = p_conversation_id
    AND status = 'active'
    AND unassigned_at IS NULL;
    
    -- Create new assignment
    INSERT INTO public.chat_assignments (
        conversation_id,
        agent_id,
        team_id,
        assigned_by
    ) VALUES (
        p_conversation_id,
        p_agent_id,
        p_team_id,
        COALESCE(p_assigned_by, auth.uid())
    )
    RETURNING id INTO assignment_id;
    
    -- Update agent's current chat count
    UPDATE public.agent_profiles
    SET current_chat_count = (
        SELECT COUNT(*)
        FROM public.chat_assignments
        WHERE agent_id = p_agent_id
        AND status = 'active'
        AND unassigned_at IS NULL
    )
    WHERE user_id = p_agent_id;
    
    RETURN assignment_id;
END;
$$;


