--
-- Name: delete_agent(uuid, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.delete_agent(p_agent_id uuid, p_workspace_id uuid DEFAULT NULL::uuid) RETURNS jsonb
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
    -- Delete from workspace_agents if workspace_id is provided
    IF p_workspace_id IS NOT NULL THEN
        DELETE FROM public.workspace_agents
        WHERE workspace_id = p_workspace_id
        AND agent_id = p_agent_id;
    ELSE
        -- Delete from all workspaces
        DELETE FROM public.workspace_agents
        WHERE agent_id = p_agent_id;
    END IF;

    -- Delete agent profile (CASCADE will handle related records)
    DELETE FROM public.agent_profiles
    WHERE user_id = p_agent_id;

    -- Remove agent role from user_roles
    DELETE FROM public.user_roles
    WHERE user_id = p_agent_id
    AND role_id IN (
        SELECT id FROM public.roles WHERE slug = 'agent'
    );

    RETURN jsonb_build_object(
        'success', true,
        'message', 'Agent deleted successfully'
    );
EXCEPTION
    WHEN OTHERS THEN
        RETURN jsonb_build_object(
            'success', false,
            'error', SQLERRM
        );
END;
$$;


