--
-- Name: get_customers_for_scheduled_message(uuid, text[], text[], text, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_customers_for_scheduled_message(p_user_id uuid, p_filter_by_tags text[], p_filter_by_labels text[], p_filter_by_message_age text, p_filter_by_last_interaction text) RETURNS TABLE(customer_id uuid)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
  RETURN QUERY
  SELECT DISTINCT c.id
  FROM customers c
  LEFT JOIN customer_tags ct ON ct.customer_id = c.id
  LEFT JOIN tags t ON t.id = ct.tag_id
  WHERE c.user_id = p_user_id
    -- Filter by tags (if provided)
    AND (
      p_filter_by_tags IS NULL 
      OR array_length(p_filter_by_tags, 1) IS NULL
      OR t.name = ANY(p_filter_by_tags)
    )
    -- Filter by message age - using created_at as proxy since last_message_at doesn't exist
    AND (
      p_filter_by_message_age IS NULL
      OR (
        p_filter_by_message_age = 'last_7_days' AND c.created_at >= NOW() - INTERVAL '7 days'
      )
      OR (
        p_filter_by_message_age = 'last_30_days' AND c.created_at >= NOW() - INTERVAL '30 days'
      )
      OR (
        p_filter_by_message_age = 'last_90_days' AND c.created_at >= NOW() - INTERVAL '90 days'
      )
      OR (
        p_filter_by_message_age = 'inactive' AND c.created_at < NOW() - INTERVAL '90 days'
      )
    )
    -- Filter by last interaction - using created_at as proxy
    AND (
      p_filter_by_last_interaction IS NULL
      OR (
        p_filter_by_last_interaction = 'last_24h' AND c.created_at >= NOW() - INTERVAL '24 hours'
      )
      OR (
        p_filter_by_last_interaction = 'last_week' AND c.created_at >= NOW() - INTERVAL '7 days'
      )
      OR (
        p_filter_by_last_interaction = 'last_month' AND c.created_at >= NOW() - INTERVAL '30 days'
      )
      OR (
        p_filter_by_last_interaction = 'no_interaction' AND c.created_at < NOW() - INTERVAL '30 days'
      )
    );
END;
$$;


ALTER FUNCTION public.get_customers_for_scheduled_message(p_user_id uuid, p_filter_by_tags text[], p_filter_by_labels text[], p_filter_by_message_age text, p_filter_by_last_interaction text) OWNER TO postgres;

