--
-- Name: get_role_permissions(uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_role_permissions(p_role_id uuid) RETURNS TABLE(group_id uuid, group_name text, group_slug text, group_is_active boolean, switch_id uuid, switch_name text, switch_slug text, switch_is_active boolean)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        pg.id as group_id,
        pg.name as group_name,
        pg.slug as group_slug,
        COALESCE(rpg.is_active, false) as group_is_active,
        ps.id as switch_id,
        ps.name as switch_name,
        ps.slug as switch_slug,
        COALESCE(rps.is_active, false) as switch_is_active
    FROM public.permission_groups pg
    LEFT JOIN public.role_permission_groups rpg 
        ON rpg.group_id = pg.id AND rpg.role_id = p_role_id
    LEFT JOIN public.permission_switches ps 
        ON ps.group_id = pg.id
    LEFT JOIN public.role_permission_switches rps 
        ON rps.switch_id = ps.id AND rps.role_id = p_role_id
    ORDER BY pg.sort_order, ps.sort_order;
END;
$$;


