--
-- Name: reject_agent_invitation(text, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.reject_agent_invitation(invitation_token text, user_uuid uuid) RETURNS jsonb
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    invitation_record RECORD;
BEGIN
    -- Get invitation
    SELECT * INTO invitation_record
    FROM public.agent_invitations
    WHERE token = invitation_token
    AND status = 'pending';
    
    IF NOT FOUND THEN
        RETURN jsonb_build_object(
            'success', false,
            'error', 'Invitation not found'
        );
    END IF;
    
    -- Verify email matches
    IF invitation_record.email != (SELECT email FROM auth.users WHERE id = user_uuid) THEN
        RETURN jsonb_build_object(
            'success', false,
            'error', 'Email does not match invitation'
        );
    END IF;
    
    -- Update invitation status
    UPDATE public.agent_invitations
    SET status = 'rejected',
        rejected_at = timezone('utc'::text, now())
    WHERE id = invitation_record.id;
    
    RETURN jsonb_build_object(
        'success', true,
        'message', 'Invitation rejected'
    );
END;
$$;


