-- Name: unassign_agent_from_chat(integer, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.unassign_agent_from_chat(p_conversation_id integer, p_agent_id uuid) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
    UPDATE public.chat_assignments
    SET status = 'completed',
        unassigned_at = timezone('utc'::text, now())
    WHERE conversation_id = p_conversation_id
    AND agent_id = p_agent_id
    AND status = 'active'
    AND unassigned_at IS NULL;
    
    -- Update agent's current chat count
    UPDATE public.agent_profiles
    SET current_chat_count = (
        SELECT COUNT(*)
        FROM public.chat_assignments
        WHERE agent_id = p_agent_id
        AND status = 'active'
        AND unassigned_at IS NULL
    )
    WHERE user_id = p_agent_id;
    
    RETURN FOUND;
END;
