--
-- Name: user_has_permission(uuid, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.user_has_permission(user_uuid uuid, permission_key text) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    has_perm BOOLEAN;
BEGIN
    SELECT EXISTS (
        SELECT 1
        FROM public.user_roles ur
        JOIN public.roles r ON r.id = ur.role_id
        WHERE ur.user_id = user_uuid
        AND (
            r.permissions->>'all' = 'true' OR
            r.permissions ? permission_key OR
            r.permissions->permission_key IS NOT NULL
        )
    ) INTO has_perm;
    
    RETURN has_perm;
END;
$$;


