-- Name: active_agents; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.active_agents AS
 SELECT ap.user_id,
    ap.display_name,
    ap.avatar_url,
    ap.status,
    ap.max_concurrent_chats,
    ap.current_chat_count,
    ap.specialties,
    ap.languages,
    u.email,
    (u.raw_user_meta_data ->> 'display_name'::text) AS user_display_name,
    array_agg(DISTINCT r.slug) AS roles
   FROM (((public.agent_profiles ap
     JOIN auth.users u ON ((u.id = ap.user_id)))
     LEFT JOIN public.user_roles ur ON ((ur.user_id = ap.user_id)))
     LEFT JOIN public.roles r ON ((r.id = ur.role_id)))
  WHERE (ap.status <> 'offline'::text)
  GROUP BY ap.user_id, ap.display_name, ap.avatar_url, ap.status, ap.max_concurrent_chats, ap.current_chat_count, ap.specialties, ap.languages, u.email, u.raw_user_meta_data;


