--
-- Name: pending_invitations; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.pending_invitations AS
 SELECT ai.id,
    ai.email,
    ai.invited_by,
    u.email AS inviter_email,
    (u.raw_user_meta_data ->> 'display_name'::text) AS inviter_name,
    ai.role_id,
    r.name AS role_name,
    r.slug AS role_slug,
    ai.token,
    ai.status,
    ai.display_name,
    ai.max_concurrent_chats,
    ai.specialties,
    ai.languages,
    ai.message,
    ai.expires_at,
    ai.created_at,
    ai.workspace_id,
        CASE
            WHEN (ai.expires_at < timezone('utc'::text, now())) THEN true
            ELSE false
        END AS is_expired
   FROM ((public.agent_invitations ai
     JOIN auth.users u ON ((u.id = ai.invited_by)))
     JOIN public.roles r ON ((r.id = ai.role_id)))
  WHERE (ai.status = 'pending'::text);


