--
-- Name: permission_groups Admins can manage permission groups; Type: POLICY; Schema: public; Owner: postgres
--

CREATE POLICY "Admins can manage permission groups" ON public.permission_groups USING ((EXISTS ( SELECT 1
   FROM (public.user_roles ur
     JOIN public.roles r ON ((r.id = ur.role_id)))
  WHERE ((ur.user_id = auth.uid()) AND (r.slug = ANY (ARRAY['super_admin'::text, 'admin'::text]))))));


